angular.module("clocks").controller("addCtrl",function(t,e,r,s){t.user=1,t.projectRate=0,t.targetHours=0,t.targetMinutes=0,t.addHours=0,t.addMinutes=0,t.submitProject=function(){s.insertProject(t.projectTitle,t.user).then(function(e){t.message=e})},t.insertProject=function(){var o=s.processInputs(t.projectRate,t.targetHours,t.targetMinutes,t.addHours,t.addMinutes);o.title=t.projectTitle,o.owner=t.user,s.insertProject(o).then(function(t){o.id=t,r.projects.push(o),r.message(t),console.log(r.displayMessage),e.path("project/"+t)})}});